import {NavLink} from 'react-router-dom';
const StyleNavbar=()=> {
    return (
<nav>
    <NavLink to='/MyPages' style={(({isActive})=>{
        return {
            color:isActive?'red':'grey'
        }
    })}> HOME </NavLink> <br/>
    <NavLink to='/MyPages/about' style={(({isActive})=>{
        return {
            color:isActive?'red':'grey'
        }
    })}> ABOUT </NavLink> <br/>
    <NavLink to='/MyPages/product' style={(({isActive})=>{
        return {
            color:isActive?'red':'grey'
        }
    })}> PRODUCT </NavLink>
</nav>
    )
}

export default StyleNavbar;
